create table loan_count
(
    id                   BIGINT(19) auto_increment
        primary key,
    borrowingReturningId BIGINT(19)   null,
    articleId            BIGINT(19)   null,
    number               VARCHAR(255) null,
    giveNumber           VARCHAR(255) null,
    giveTime             BIGINT(19)   null
)
    charset = utf8mb4;

